    const handleGradeUpdate = async (studentId, subject, newGrade)=>{
        try {
            const response = await fetch("/api/grades", {
                method: "POST",
                headers: {
                    "Content-Type": "application/json"
                },
                body: JSON.stringify({
                    studentId,
                    subject,
                    grade: newGrade
                })
            });
            const data = await response.json();
            if (data.success) {
                showAlert({
                    message: "Grade updated successfully!",
                    type: "success"
                });
                // Reload the page to show updated grades
                window.location.reload();
            } else {
                showAlert({
                    message: data.error || "Failed to update grade. Please try again.",
                    type: "error"
                });
            }
        } catch (error) {
            console.error("Grade update error:", error);
            showAlert({
                message: "Error updating grade. Please try again.",
                type: "error"
            });
        }
    };
